import React from 'react';
import Ikun from '../Assets/ikun.png';

export default function UserIcon() {
  return (
    <div class="container">
    <img src={Ikun} alt="Image" class="userIcon" />
    <div class="dropdown">
        <div class="dropdown-content">
        <a href="#">Option 1</a>
        <a href="#">Option 2</a>
        <a href="#">Option 3</a>
        </div>
    </div>
    </div>

  )
}
